import React from 'react';

export const Post = (props) => {
    const loadPosts = props.loadPosts;
    const listItems = loadPosts.allPosts.map(row => (
		    		<p> {row.text} </p> 
		    		))
    return (
        <ul>{listItems}</ul>
    );
}
